import React, {Component} from 'react'
import queryString from 'query-string'
import axios from 'axios'
import UsersStyle from '../components/styles/UsersStyle.css'
import {Button} from 'reactstrap'

class LoadStreamers extends React.Component{
  render(){
    const { infoName, infoImg, infoBio } = this.props
    if(infoBio==null){
      console.log(infoBio)
    }else{
      console.log(infoBio)
    }
    return (
      <div className="list list-row block">
      <div className="list-item" data-id="19">
        <div>
          <span className="w-48 avatar gd-warning"><img src={infoImg} className="p-1" /> </span>
          </div>
          <div className="flex"> <a href="#" className="item-author text-color">{infoName}</a>
              <div className="item-except text-muted text-sm h-1x"> Streamer Oficial</div>
          </div>
          <div className="no-wrap mx-auto">
              <div className="item-date text-muted text-sm d-none d-md-block">
              <Button className="border-light mr-auto shadow p-2 col-12 text-muted" >Seguiendo...</Button>
              </div>
          </div>
      </div>
    </div>
    )
  }
}

export default LoadStreamers
